PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?authorName WHERE {
  <https://dblp.org/rec/conf/icapr/WangL05> dblp:authoredBy ?author .
  ?author dblp:creatorName ?authorName .
  FILTER ( ?authorName = "Graham Leedham" || ?authorName = "Lingyu Wang" )
}

