PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ?paper ?numAuthors WHERE {
  VALUES ?paper {
    <https://dblp.org/rec/journals/tcyb/MaB21> <https://dblp.org/rec/conf/etfa/Missal0H07>
  }
  ?paper dblp:authoredBy ?author .
  {
    SELECT ?paper ( COUNT( DISTINCT ?author ) AS ?numAuthors ) WHERE {
      ?paper dblp:authoredBy ?author .
    }
    GROUP BY ?paper
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT ?coauthor ?coauthorName ?affiliation WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/286/6829> ; dblp:authoredBy ?coauthor ; dblp:yearOfPublication ?year .
  FILTER ( ?year >= YEAR( NOW () ) - 2 && ?coauthor != <https://dblp.org/pid/286/6829> ) ?coauthor dblp:creatorName ?coauthorName .
  OPTIONAL {
    ?coauthor dblp:primaryAffiliation ?affiliation
  }
}

